PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE player(
player_id INTEGER NOT NULL,
gsis_id VARCHAR,
first_name VARCHAR NOT NULL,
last_name VARCHAR NOT NULL,
position VARCHAR NOT NULL,
last_changed_date DATE NOT NULL,
PRIMARY KEY(player_id)
);
CREATE TABLE performance(performance_id integer not null,week_number varchar not null,fantasy_points float not null,player_id integer not null,last_changed_date date not null,primary key(performance_id),foreign key(player_id)references player(player_id));
CREATE TABLE league(league_id integer not null,league_name varchar not null,scoring_type varchar not null,last_changed_date date not null,primary key(league_id));
CREATE TABLE team(team_id integer not null,team_name varchar not null,league_id integer not null,last_changed_date date not null,primary key(team_id),foreign key(league_id)references league (league_id));
CREATE TABLE team_player(team_id integer not null,player_id integer not null,last_changed_date date not null,primary key(team_id,player_id),foreign key(team_id)references team(team_id),foreign key(player_id)references player(player_id));
COMMIT;
